import React from 'react';
import image1 from '../assets/image-ai3.png';
import image2 from '../assets/image-ai2.jpg';
import image3 from '../assets/NTR-image.jpg';

const AiMLPage = () => {
  return (
    <div className="p-8 bg-gray-50 min-h-screen">
      <h1 className="text-4xl font-bold text-center mb-6">AI / ML Alumni</h1>
      <p className="text-center text-gray-600 mb-10 max-w-3xl mx-auto">
        Meet our accomplished alumni from the Artificial Intelligence and Machine Learning specialization. These individuals have made significant contributions to cutting-edge research, innovative startups, and major tech companies around the world.
      </p>

      <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6">
        {/* Alumnus 1 */}
        <div className="bg-white shadow-lg rounded-2xl p-6 hover:shadow-xl transition">
          <img
            src={image1}
            alt="Dr. Asha Verma"
            className="w-full h-32 object-cover rounded-xl mb-4"
          />
          <h2 className="text-xl font-semibold">Dr. Asha Verma</h2>
          <p className="text-sm text-gray-500">Research Scientist at Google AI</p>
          <p className="text-sm mt-2">Class of 2012</p>
        </div>

        {/* Alumnus 2 */}
        <div className="bg-white shadow-lg rounded-2xl p-6 hover:shadow-xl transition">
          <img
            src={image2}
            alt="Rohan Mehta"
            className="w-full h-32 object-cover rounded-xl mb-4"
          />
          <h2 className="text-xl font-semibold">Rohan Mehta</h2>
          <p className="text-sm text-gray-500">AI Engineer at OpenAI</p>
          <p className="text-sm mt-2">Class of 2015</p>
        </div>

        {/* Alumnus 3 */}
        <div className="bg-white shadow-lg rounded-2xl p-6 hover:shadow-xl transition">
          <img
            src={image3}
            alt="Sneha Kapoor"
            className="w-full h-32 object-cover rounded-xl mb-4"
          />
          <h2 className="text-xl font-semibold">Sneha Kapoor</h2>
          <p className="text-sm text-gray-500">Machine Learning Lead at Amazon</p>
          <p className="text-sm mt-2">Class of 2014</p>
        </div>
      </div>
    </div>
  );
};

export default AiMLPage;
